import { Navbar } from 'react-bootstrap';

function NavbarDesktop(props) {
  return (
    <Navbar bg="light" expand="lg">
      <Navbar.Brand href="#home">Brand link</Navbar.Brand>
    </Navbar>
  );
}

export default NavbarDesktop;
